include ArrayHelper

class UploadDictionaryJob
  @mandarin

  def perform
    chinese = Language.get_or_create "Chinese (Simplified)"
    english = Language.get_or_create "English"

    set = Sets.create
    SetName.create(:sets_id => set.id, :name => "Chinese - Frequenecy of Use")

    position = 1
    chapter_size = 100
    @mandarin.each do |mandarin_group|
      position = mandarin_group[:position].to_i
      form = mandarin_group[:form]

      pronunciations = mandarin_group[:pronunciation].split('/')
      meanings = []
      mandarin_group[:meaning].split('/').each do |meaning|
        meanings << meaning.split(',')
      end

      meanings.flatten!
      meanings.compact!
      meanings.each {|m| m.strip!}

      meanings.each do |meaning|
        idiom = Idiom.create

        pronunciations.each do |pronunciation|
          pronunciation.strip!
          pronunciation ||= ""

          translation = get_first(Translation.where(:form => form, :language_id => chinese.id))
          translation ||= Translation.create(:form => form, :language_id => chinese.id, :pronunciation => pronunciation)
          IdiomTranslation.create(:idiom_id => idiom.id, :translation_id => translation.id)
        end
        if pronunciations.empty?
          translation = get_first(Translation.where(:form => form, :language_id => chinese.id))
          translation ||= Translation.create(:form => form, :language_id => chinese.id, :pronunciation => "")
          IdiomTranslation.create(:idiom_id => idiom.id, :translation_id => translation.id)
        end

        translation = Translation.create(:form => meaning, :language_id => english.id, :pronunciation => "")
        IdiomTranslation.create(:idiom_id => idiom.id, :translation_id => translation.id)

        SetTerms.create(:set_id => set.id, :term_id => idiom.id, :position => position, :chapter => (position / chapter_size) + 1)
        position = position + 1
      end
    end
  end






